import React from 'react';
import { makeStyles } from '@material-ui/core/styles';
import Card from '@material-ui/core/Card';


export default function DrinkCards() {
	const classes = makeStyles({
		root: {
			minWidth: 275,
		},
		title: {
			fontSize: 14,
		},
		pos: {
			marginBottom: 12,
		},
	});

	return (
		<Card className={classes.root}>
			Hello
		</Card>
 );
}
